import { Affix, Button, Divider, Layout } from "antd";
import { HomeOutlined } from "@ant-design/icons";
export const SideBar = () => {
  return (
    <div style={{ width: "100%" }}>
      <Layout
        style={{
          padding: "20px",
          width: "250px",
          background: "#fadb14",
          boxShadow: "2px 2px 2px #d4b106",
        }}
      >
        <span style={{ fontSize: 30 }}>
          {" "}
          <img
            style={{
              width: "75px",
              borderRadius: 10,
              boxShadow: "2px 2px 2px 0",
            }}
            src={`./mill-eye-icon.png`}
          />{" "}
          Yuco
        </span>
        <Divider style={{ fontWeight: "bold" }} />

        <Row>
          <Col>
            <HomeOutlined style={{ fontSize: 30 }} />
          </Col>
          <Col>
            <Button type="text" style={{ height: 50 }}>
              <span style={{ fontSize: 24, fontWeight: "bold" }}>HOME</span>
            </Button>
          </Col>
        </Row>

        <Button></Button>
        <Button></Button>
        <Button></Button>
      </Layout>
    </div>
  );
};
